angular.module( 'ComfirmApp', [])
.controller( 'ComfirmController', function( $scope, SdkUrl, HttpService, $timeout, $log ){
	var _merchantId = $( '#merchantId' ).val();
	var _orderId = $( '#orderId' ).val();
	$scope.address = {};
	$scope.instalmentItems = [];
	$scope.instalmentItems[0] = {
		id: '',
		desc: '不分期'
	}

	$scope.getInstalment = function(){
		var url = SdkUrl.getInstalment;
		var message = {
			merchant_id: _merchantId,
			order_id: _orderId
		};
		var pGet = HttpService.templateAccessAPI( url, message );
		pGet.then( function( result ){
			$log.debug( 'user get instalment success', result );
			if( result.items != undefined || result.items != '' ){
				angular.forEach( result.items, function( value, key ){
					value.desc = '￥'+value.month_pay + 'X' + value.terms + '期' + '(含手续费 ' + value.month_charge + ' 元/期 )';
					$scope.instalmentItems.push( value );
				} )
			}
			$scope.currentInstalment = $scope.instalmentItems[0];
		}, function( reason ){
			$log.debug( 'user get instalment failed', reason );
			$scope.currentInstalment = $scope.instalmentItems[0];
		} )
	};

	$scope.applyInstalment = function(){
		if( $scope.currentInstalment.id == '' ){
			$scope.applyAddress();
			return;
		}
		var url = SdkUrl.applyInstalment;
		var message = {
			merchant_id: _merchantId,
			order_id: _orderId,
			term_id: $scope.currentInstalment.id
		};
		var pGet = HttpService.templateAccessAPI( url, message );
		pGet.then( function( result ){
			$log.debug( 'user apply instalment success', result );
			$scope.applyAddress();
		}, function( reason ){
			$log.debug( 'user apply instalment failed', reason );
			$scope.errorMsg = reason.message;
		} )
	};

	$scope.getAddress = function(){
		var url = SdkUrl.getAddresses;
		var message = {
			merchant_id: _merchantId,
			order_id: _orderId
		};
		var pGetAddresses = HttpService.templateAccessAPI( url, message );
		pGetAddresses.then( function( result ){
			$log.debug( 'get address success', result );
			angular.forEach( result.items, function( value, key ){
				if( value.is_primary == 1 ){
					$scope.address = value;
					return;
				}
			});
			if( $scope.address.name == undefined ){
				$scope.address = result.items[0];
			}
			$('#receiverPhone').val( $scope.address.phone );
			$('#receiverName').val( $scope.address.name );
			$('#receiverAddress').val( $scope.address.address );
			$('#addressId').val( $scope.address.address_id );
		}, function( reason ){
			$log.debug( 'get address failed', reason );
		} )
	};
	$scope.applyAddress = function(){
		var url = SdkUrl.applyAddress;
		var _addressId = $( '#addressId' ).val();
		var message = {
			address_id: _addressId,
			merchant_id: _merchantId,
			order_id: _orderId
		};
		var pApply = HttpService.templateAccessAPI( url, message );
		pApply.then( function( result ){
			$log.debug( 'this order apply its address success', result );
			window.location.href='/mobile/checkout/payment?merchant='+_merchantId+'&order='+_orderId+'&action=10008';
		}, function( reason ){
			$log.debug( 'this order apply its address failed', reason );
		})
	}

	$scope.next = function(){
		$scope.errorMsg = '';
		var _addressId = $( '#addressId' ).val();
		if( _addressId == '' || _addressId == undefined == _addressId == null ){
			$scope.errorMsg = '请先选择收货地址';
		}else{
			$scope.applyInstalment();
		}
	}

	$scope.changeAddress = function(){
		window.location.href = '/mobile/checkout/myAddress?merchant='+_merchantId+'&order='+_orderId+'&action=10019';
	}
	
	$scope.getAddress();
	$scope.getInstalment();
    
} )
.controller( 'MyAddressController', function( $scope, SdkUrl, HttpService, $timeout, $log ){
	var _merchantId = $( '#merchantId' ).val();
	var _orderId = $( '#orderId' ).val();
	$scope.loadingData = false;
	$scope.getAddress = function(){
		var url = SdkUrl.getAddresses;
		var message = {
			merchant_id: _merchantId,
			order_id: _orderId
		};
		$scope.loadingData = true;
		var pGetAddresses = HttpService.templateAccessAPI( url, message );
		pGetAddresses.then( function( result ){
			$log.debug( 'get address success', result );
			$scope.addressItems = result.items ;
		}, function( reason ){
			$log.debug( 'get address failed', reason );
		} ).then( function(){
			$scope.loadingData = false;
		})
	};

	$scope.addAddress = function(){
	    window.location.href = '/mobile/checkout/addAddress?merchant='+_merchantId+'&order='+_orderId+'&action=10020';
	}

	$scope.redirectBack = function( addressObj ){
		var redirectUrl  = SdkUrl.backConfirm + JSON.stringify( {  code: '200', message: '返回confirm页面', result:{ id:'myAddress', 
			address: addressObj.address,
		    phone: addressObj.phone,
		    name: addressObj.name,
		    address_id: addressObj.address_id
		} } );
		window.location.href = redirectUrl;
	}

	$scope.getAddress();

} )
.controller( 'AddAddressController', function( $scope, SdkUrl, HttpService, $log, ProvinceData, CityData, CountyData ){
	var _merchantId = $( '#merchantId' ).val();
	var _orderId = $( '#orderId' ).val();
	$scope.errorMsg = '';
	$scope.phoneLength = 11;
	$scope.postalLength = 6;

	//address config
	$scope.address = {};
    $scope.provinceItems = ProvinceData.items;
    $scope.address.province = $scope.provinceItems[0];
    $scope.cityItems = CityData.items[$scope.address.province['province_id']];
    $scope.address.city = $scope.cityItems[0];
    $scope.countyItems = CountyData.items[$scope.address.city['city_id']];
    $scope.address.county = $scope.countyItems[0];

	$scope.provinceChange = function(){
		$scope.cityItems = CityData.items[$scope.address.province['province_id']];
		$scope.address.city = $scope.cityItems[0];
		$scope.countyItems = CountyData.items[$scope.address.city['city_id']];
		$scope.address.county = $scope.countyItems[0];
	}
	$scope.cityChange = function(){
		$scope.countyItems = CountyData.items[$scope.address.city['city_id']];
		$scope.address.county = $scope.countyItems[0];
	}
    var notEmpty = function( _array ){
    	$scope.errorMsg = '';
        for( var i in _array ){
            if( _array[i] == '' || _array[i] == undefined || _array[i] == null ){
                $scope.errorMsg = i+'不能为空';
                return;
            }
        }
    }
	$scope.saveAddress = function(){
		notEmpty( { "收件人姓名":$scope.username, "收件人手机":$scope.phone, "详细地址":$scope.addressDetail } );
		if( $.trim( $scope.phone ).length != $scope.phoneLength ) $scope.errorMsg = '收件人手机号必须是 '+$scope.phoneLength +'位';
		if( $scope.errorMsg != '' ) return;
		var url = SdkUrl.addAddress;
		var message = {
           name: $scope.username,
           phone: $scope.phone,
           province_id: $scope.address.province['province_id'],
           city_id: $scope.address.city['city_id'],
           county_district_id: $scope.address.county['county_district_id'],
           postal_code: $scope.postal,
           address_detail: $scope.addressDetail,
           order_id: _orderId,
           merchant_id: _merchantId
		};
		var pSave = HttpService.templateAccessAPI( url, message );
		pSave.then( function( result ){
			$log.debug( 'save address success', result );
			var redirectUrl  = SdkUrl.backConfirm + JSON.stringify({code:'200', message: '返回confirm页面', result: { 
				id:'myAddress', 
				address: $scope.address.province['province_name'] +' '+$scope.address.city['city_name']+' '+ $scope.address.county['county_district_name'] + $scope.addressDetail,
				phone: $scope.phone,
				name: $scope.username,
				address_id: result.address_id
			}});
			// console.log( redirectUrl );
			window.location.href = redirectUrl;
		}, function( reason ){
			$log.debug( 'save address failed', reason );
			$scope.errorMsg = reason.message;
		} )
	}

})
.factory('SdkUrl', function(){
	var hostName = '';
	return{
		sessionExpired: 'pierpay://pier?platform=ios&action=',
		getInstalment: '/mobile/checkout/getInstalment',
		applyInstalment: '/mobile/checkout/applyInstalment',
		getAddresses: '/mobile/checkout/getAddresses',
		addAddress: '/mobile/checkout/addAddress',
		backConfirm: 'pierpay://pier?platform=ios&action=10018&result=',
		applyAddress: '/mobile/checkout/applyOrderAddress'
	}
})

.factory('HttpService', function( $log, $http, $q, SdkUrl ){
	return {
	    //url call template
	    templateAccessAPI: function( apiUrl, msg ){
	      var d = $q.defer(),
	          url = apiUrl;
	      $http.post( url, msg )
	        .success( function( data, status, headers, config ) {
	          switch( data.code ){
	            case "200" :
	               d.resolve( data.result );
	               break;
	            case "1001" :
	                var actionCode = '10004';
	                var _merchantId = $( '#merchantId' ).val();
	                var _orderId = $( '#orderId' ).val();
		            var _url = SdkUrl.sessionExpired + actionCode + '&result='+ JSON.stringify( { code: "1001", msg: "failed", result:{ url: '200002', merchant_id: _merchantId, order_id: _orderId } } );
		            $log.debug( 'session 过期', _url ); 
		            // _url = '/test.html?order='+_orderId+'&merchant='+_merchantId;
		            window.location.href = _url;
	               break;
	            case "500" :
	               window.location.href="/checkout/unknownError";
	               break;
	            default :
	              d.reject( data );
	          }
	        } )
	        .error( function( data, status, headers, config ) {
	            d.reject( data );
	        } );
	      return d.promise;
	    }
	}
})
.directive( 'numberOnlyInput', function() {
	return {
		restrict: 'A',
		scope: false,
		require: 'ngModel',
		link: function( scope, elem, attrs, controller ) {
			controller.$parsers.push( function( input ) {
				if ( input == undefined ) return '';
				// delete non-number string
				var numberInput = input.replace( /[^0-9]/g, '' );
				if ( numberInput != input ) {
					controller.$setViewValue( numberInput );
					controller.$render();
				}
				return numberInput;
			} );
		}
	};
} )
